ST.xhtml:
//Resetter forgje VAVs verdier
	IF xReset THEN
		i:= 0;
		xRetry:= FALSE;
		xFailed:= FALSE;
		sSetStatus:= '';
		sGetStatus:= '';

//Begynner paa neste VAV
	ELSIF i<1 AND xNext THEN
		VAV_Addressing
		(
			bPortMpBus:= bPort,
			bAddress:= bAddress,
			typINSerialNo:= iSerialNr,
			xLearn:= xLearn
		);
		i:= 1;

//Skriver rett port og adresse til VAV naar blokken er klar
	ELSIF VAV_Addressing.xReady AND i=1 THEN
		VAV_Addressing
		(
			xSet:= TRUE,
			xLearn:= xLearn
		);
		i:= 2;

//Spoer etter serie nr som hoerer til port og adresse
	ELSIF VAV_Addressing.xReady AND i=2 THEN
		sSetStatus:= VAV_Addressing.sStatus;
		VAV_Addressing
		(
			xGetSerialNO:= TRUE,
			xLearn:= xLearn
		);
		i:= 3;

//Sjekker om serie nr. som tilhoerer port og adressen stemmer
	ELSIF VAV_Addressing.xReady AND i=3 THEN
		sGetStatus:= VAV_Addressing.sStatus;
		//Sjekker om serie nr stemmer
		IF xRetry AND VAV_Addressing.typOUTSerialNo.wYearAndWeek <> iSerialNr.wYearAndWeek OR VAV_Addressing.typOUTSerialNo.wDayAndNumber <> iSerialNr.wDayAndNumber OR VAV_Addressing.typOUTSerialNo.bTypeID <> iSerialNr.bTypeID OR VAV_Addressing.typOUTSerialNo.bTestStation <> iSerialNr.bTestStation THEN
			xRetry:= FALSE;
			xFailed:= TRUE;
			i:=4;
		ELSIF VAV_Addressing.typOUTSerialNo.wYearAndWeek <> iSerialNr.wYearAndWeek OR VAV_Addressing.typOUTSerialNo.wDayAndNumber <> iSerialNr.wDayAndNumber OR VAV_Addressing.typOUTSerialNo.bTypeID <> iSerialNr.bTypeID OR VAV_Addressing.typOUTSerialNo.bTestStation <> iSerialNr.bTestStation THEN
			xRetry:= TRUE;
			i:=1;
		ELSE
			i:=4;
		END_IF

//Resetter xSet og xGet, og Setter Port, adresse og serie nr. og henter status
	ELSE
		VAV_Addressing
		(
			bPortMpBus:= bPort,
			bAddress:= bAddress,
			typINSerialNo:= iSerialNr,
			xLearn:= xLearn,
			xSet:= FALSE,
			xGetSerialNO:= FALSE,
			xLearn:= xLearn
		);
	END_IF

IF xReset THEN
	Auto(xReset:= TRUE);
	xInit:= TRUE;
	xReset:= FALSE;
